source:"window.addEventListener('bambuser-liveshop-tracking-point', ({ detail }) => {\n    if (detail.event == 'on-pending') {    // Live Commerce Player (1) - 1. Popup Open\n        _satellite.setVar('tr', 'dc-live commerce');\n        _satellite.setVar('ca', 'live commerce');\n        _satellite.setVar('ac', 'feature');\n        _satellite.setVar('la', detail.data.showId + ':live show viewer:pending');\n        _satellite.track('live commerce');\n    } else if (detail.event == 'on-play' && detail.data.timeline.isLive==true) {\n        _satellite.setVar('tr', 'dc-live commerce');\n        _satellite.setVar('ca', 'live commerce');\n        _satellite.setVar('ac', 'feature');\n        _satellite.setVar('la', detail.data.showId + ':live show viewer:start');\n        _satellite.track('live commerce');\n    } else if (detail.event == 'on-interaction') {\n        if (detail.data.interactionType == 'chatMessage') {    // Live Commerce Player (2) - 1. Chat Submit\n            _satellite.setVar('tr', 'dc-live commerce');\n            _satellite.setVar('ca', 'live commerce');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', detail.data.showId + ':chat:submit');\n            _satellite.track('live commerce');\n        } else if (detail.data.interactionType=='action-bar:share') {    // Live Commerce Player (2) - 2. Video Share\n            _satellite.setVar('tr', 'dc-live commerce');\n            _satellite.setVar('ca', 'live commerce');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', detail.data.showId + ':live video:share');\n            _satellite.track('live commerce');\n        } else if (detail.data.interactionType == 'like') {    // Live Commerce Player (2) - 3. Video Like\n            _satellite.setVar('tr', 'dc-live commerce');\n            _satellite.setVar('ca', 'live commerce');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', detail.data.showId + ':live video:like');\n            _satellite.track('live commerce');\n        } else if (detail.data.interactionType == 'close') {    // Live Commerce Player (3) - 1. Video Close\n            _satellite.setVar('tr', 'dc-live commerce');\n            _satellite.setVar('ca', 'live commerce');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', detail.data.showId + ':live video:close');\n            _satellite.track('live commerce');\n        } else if (detail.data.interactionType == 'resume') {    // Live Commerce Player (3) - 2. Video Play\n            _satellite.setVar('tr', 'dc-live commerce');\n            _satellite.setVar('ca', 'live commerce');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', detail.data.showId + ':live video:play');\n            _satellite.track('live commerce');\n        } else if (detail.data.interactionType == 'pause') {    // Live Commerce Player (3) - 2. Video Stop\n            _satellite.setVar('tr', 'dc-live commerce');\n            _satellite.setVar('ca', 'live commerce');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', detail.data.showId + ':live video:stop');\n            _satellite.track('live commerce');\n        } else if (detail.data.interactionType.includes('show-product')) {    // Live Commerce Player (3) - 3. Product Click\n            _satellite.setVar('tr', 'dc-live commerce');\n            _satellite.setVar('ca', 'live commerce');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', detail.data.showId + ':featured product:product click:' + detail.data.sku);\n            _satellite.track('live commerce');\n        } else if (detail.data.interactionType=='pending-curtain:addToCalendar') {    // Live Commerce Upcoming (2) - 1. Add To Calendar\n            _satellite.setVar('tr', 'dc-content click');\n            _satellite.setVar('ca', 'content click');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', 'add to calendar popup:add to calendar');\n            _satellite.track('content click');\n        } else if (detail.data.interactionType.includes('pending-curtain:addToCalendar:')) {    // Live Commerce Upcoming (2) - 1. Add To Calendar\n            _satellite.setVar('tr', 'dc-content click');\n            _satellite.setVar('ca', 'content click');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', 'add to calendar popup:add to calendar:'+detail.data.interactionType.replace('pending-curtain:addToCalendar:',''));\n            _satellite.track('content click');\n        } else if (detail.data.interactionType=='pending-curtain:share') {    // Live Commerce Upcoming (2) - 1. Add To Calendar\n            _satellite.setVar('tr', 'dc-content click');\n            _satellite.setVar('ca', 'content click');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', 'add to calendar popup:share');\n            _satellite.track('content click');\n        } else if (detail.data.interactionType.includes('pending-curtain:share:')) {    // Live Commerce Upcoming (2) - 1. Add To Calendar\n            _satellite.setVar('tr', 'dc-content click');\n            _satellite.setVar('ca', 'content click');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', 'add to calendar popup:share:'+detail.data.interactionType.replace('pending-curtain:share:',''));\n            _satellite.track('content click');\n        } else if(detail.data.interactionType.includes('action-bar:share:')){\n            _satellite.setVar('tr', 'dc-live commerce');\n            _satellite.setVar('ca', 'live commerce');\n            _satellite.setVar('ac', 'feature');\n            _satellite.setVar('la', detail.data.showId +':live video:share:'+detail.data.interactionType.replace('action-bar:share:',''));\n            _satellite.track('live commerce');\n        }\n    }\n});",languag